求解关于 $x$ 的同余方程 $$ \begin{cases} x \equiv a_1 &\pmod {m_1} \\ x \equiv a_2 &\pmod {m_2} \\ &\vdots \\ x \equiv a_n &\pmod {m_n} \end{cases} $$ 保证 $\{m_i\}$ 互质。 // @description 扩展欧几里得 tuple<ll, ll, ll> exgcd(ll a, ll b) { if (b == 0) { return {1, 0, a}; } else { auto [y, x, g] = exgcd(b, a % b); return {x, y - a / b * x, g}; }
