求解关于 $x$ 的同余方程 $$ \begin{cases} x \equiv a_1 &\pmod {m_1} \\ x \equiv a_2 &\pmod {m_2} \\ &\vdots \\ x \equiv a_n &\pmod {m_n} \end{cases} $$ 不保证 $\{m_i\}$ 互质，但保证 $\operatorname{lcm}(m_i) < 10^{18}$。 // @description 扩展欧几里得 tuple<ll, ll, ll> exgcd(ll a, ll b) { if (b == 0) { return {1, 0, a}; } else { auto [y, x, g] = exgcd(b, a % b); return {x, y - a / b * x, g}; }
} ll inv_gcd(ll a, ll p) { return (get<0>(exgcd(a, p)) % p + p) % p;
} // @description 扩展中国剩余定理 using i128 = __int128_t; template<class PAIR>
ll excrt(const vector<PAIR> &am) { auto [ans, M] = am[0]; for (auto [a, m] : am) { if (M % m == 0 && ans % m == a) continue; ll B = (a - ans % m + m) % m; auto [x, y, g] = exgcd(M, m); if (B % g != 0) return -1; x = i128(x) * (B / g) % (m / g); ans += M * x, M *= m /g; ans = (ans + M) % M; } return ans;
}

